description:
We're all secretly voyeurs. For some of us, our voyeuristic moments are accidental opportunities. Like being on a late night walk and seeing a naked woman through an open window. For Ryan Madison they're premeditated works of art and manipulation. A cure, cuddly teddy bear with a hidden camera serves as a Trojan horse to get the most intimate look into the lives of these innocent teens. It's a moral issue Ryan struggles with but sometimes temptation can be absolutely overwhelming.

